webpackJsonp([3878719243016],{3121:function(n,e){n.exports={data:{markdownRemark:{html:"<h2>Remarks</h2>\n<p>It was a PC donated to my younger brother in early 2003, but my brother came home as if PC was new. Worked as an experimental mackerel PC.</p>\n<p>I should return to desk main environment soon. Also, the PC's own work heat started to recur.</p>\n<p>As it is expected to enter Windows 7 indeed truly it will be sold at 1 yen at the net auction. But later I was optimally as a test environment for low specs, I regretted violently. I changed gravo only to GeForce 3 ~ 4Ti class guy (programmable shader is one thing)), Windows 7 is the best environment if you put XP in it ...... orz</p>\n<h2>Performance</h2>\n<ul>\n<li>\n<p>CPU: intel Celeron (Coppermine-128K / 600 MHz)</p>\n</li>\n<li>\n<p>RAM: 512 MB (PC - 133)</p>\n</li>\n<li>\n<p>VGA: nVidia GeForce 2 MX 400 (VRAM 32 MB)</p>\n</li>\n<li>\n<p>HDD: 60GB + 40GB (JBOD)</p>\n</li>\n<li>\n<p>CDD: CD-RW. Details unknown (x 52, junk item)</p>\n</li>\n<li>\n<p>FDD: 3.5 inch (3mode) × 1</p>\n</li>\n<li>\n<p>NET: PLANEX GN-1200TW (1000 Base-T)</p>\n</li>\n<li>\n<p>SOUND: onBoard</p>\n</li>\n<li>\n<p>OS: Fedora 8 → Windows 7 Enterprise</p>\n</li>\n<li>\n<p>Latest specifications of 1999 class</p>\n<h2>Windows Experience Index</h2>\n</li>\n</ul>\n<p>Measurement → mysterious phenomenon that there is no score orz</p>",frontmatter:{cover:null,date:"2007-04-14T17:00:00+09:00",strDate:"2007/4/14",title:"(2007-2010) World's fastest No. 1 Ver. 2.1"}}},pathContext:{path:"/en/blog/2007/04/14-2007-2010-世界最速1号ver2-1/",langKey:"en"}}}});
